import { connect } from "react-redux";

import "./checkoutProduct.styles.css";

const CheckoutProduct = ({ name, count }) => {
  return (
    <div key={count.key} className="checkout-product">
      <span>Product</span>
      <span>{`${count} * ${name}`}</span>
    </div>
  );
};

